import React, {Component} from 'react'

class Inbox extends Component
{
    render()
    {
        return (
            <section className="bg-primary text-white mb-0 RegisterHeader">
             <div className="container">
            <h1>Inbox</h1>
            </div>
            </section>
        );
    }
}

export default Inbox;
